import{_ as e,p as t,q as p,a1 as a}from"./framework-5866ffd3.js";const _={},c=a('<h1 id="_08-14-工作日报" tabindex="-1"><a class="header-anchor" href="#_08-14-工作日报" aria-hidden="true">#</a> 08/14 工作日报！</h1><ol><li><p>昨天的文章竟然一反常态有将近200的阅读，看来这种追热点的文章还真能带来一些流量。</p></li><li><p>自从调到这个部门，主管就拉了个小群，包含主管在内有三个老前端，他们都是之前参与过这个项目的开发的，接着，主管让我在这个群里每天都发日报，只有我一个人要发，他们三个人负责review和给反馈。</p><p>这件事不同的人会有不同的解读。</p><p>我的第一感觉，就是束缚，部门内没有人要发，只有我要发，这种被特殊对待的感觉是很不好的，满满的监督感。</p><p>不过我也懒得多想，我一想，反正老子擅长写东西，我就把每一天做过的内容，事无巨细，都写上去，万万不能遗漏，少一一件都是亏的。</p><p>喜欢看是吧，给我好好看，不要辜负我付出的每一份时光。</p><p>所以，我现在每天的日报都能写个好几百字，让你们看看，我有多认真工作！</p><p>气死我了，凭什么只有我要发！</p></li></ol>',2),o=[c];function r(i,l){return t(),p("div",null,o)}const s=e(_,[["render",r],["__file","14.html.vue"]]);export{s as default};
